import React, { useState, useEffect } from "react";
import axios from "axios";

function User({ userType }) {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        let endpoint = '';
        switch (userType) {
          case 'doctor':
            endpoint = 'http://localhost:5000/getDoctors';
            break;
          case 'patient':
            endpoint = 'http://localhost:5000/getPatients';
            break;
          case 'admin':
            endpoint = 'http://localhost:5000/getAdmins';
            break;
          default:
            break;
        }
        const response = await axios.get(endpoint);
        setUsers(response.data);
      } catch (error) {
        console.log(error);
      }
    };
    fetchUsers();
  }, [userType]);
 
  return (
    <div>
      {users.map((user, index) => (
        <div key={index}>
          <h1>{user.firstname}</h1>
          <h1>{user.email}</h1>
        </div>
      ))}
    </div>
  );
      }
      export default User;
